def superstrip(path_bron, path_doel):
    import codecs
    file = codecs.open(path_bron, 'r', 'utf-8')
    lines = [line.strip() for line in file]
    text = " ".join(lines)
    file.close()
    file = codecs.open(path_doel, 'w', 'utf-8')
    file.write(text)
    file.close()

